import React from "react";
import Protypes from "prop-types";

const foodLike = [
  {
    id: 1,
    name: "Kimchi",
    image:
      "data:image/jpeg;base64,",
    rating: 5
  },
  {
    id: 2,
    name: "Bibimbap",
    image:
      "data:image/jpeg;base64,",
    rating: 4.8
  },
  {
    id: 3,
    name: "Jabchei",
    image:
      "data:image/jpeg;base64,",
    rating: 4.7
  },
  {
    id: 4,
    name: "Ricecake",
    image:
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT9mmeSHo7HIHai46FJ8CTmg-yZ9XTfkHYLz0zR13u0FW4S61WQ&s",
    rating: 5.5
  },
  {
    id: 5,
    name: "Galbi",
    image:
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRZcQmZcLci05wpdAGH2zCv8gFMXJ272j3KC_IbpZ2LFCFdZpU-&s",
    rating: 4.7
  }
];

function Food({ name, picture, rating }) {
  return (
    <div>
      <h2>I like {name}</h2>
      <img src={picture} alt={name} />
      <h4>{rating}/5.0</h4>
    </div>
  );
}

Food.propTypes = {};

function App() {
  return (
    <div>
      <h1>Hello</h1>
      {foodLike.map(dish => (
        <Food
          key={dish.id}
          name={dish.name}
          picture={dish.image}
          rating={dish.rating}
        />
      ))}
    </div>
  );
}

export default App;
